import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';
import logo from '../../assets/logo.png';
import emp from '../../assets/emp.PNG';
import '../../styles.css';  // Assurez-vous d'importer les styles


const Ife4 = () => {
    const navigate = useNavigate();
    const [employeeCount, setEmployeeCount] = useState(0);

    const goToInterface3 = () => {
        navigate('/Entreprise/Ife4');  // Navigue vers l'interface 3
    };

    const handleBackClick = () => {
        navigate('/Entreprise/Ife2'); 
      };
    
    const incrementCount = () => {
        setEmployeeCount(employeeCount + 1);
    };

    const decrementCount = () => {
        if (employeeCount > 0) {
          setEmployeeCount(employeeCount - 1);
        }
    };

    return (
        <div className="main-content">
            <div className="header">
                <NavBar />
            </div>
    
            {/* Intégration du composant InfoTooltip sous la NavBar */}
            <div className="info-tooltip-section">
            <div className="go-back-text" onClick={handleBackClick}>
            &lt;Retour
            </div>
                <InfoTooltip />
            </div>
            <div className="survey-content">
                <h3>Combien d'employés seraient en appels vidéo?</h3>
                <p className="survey-description">Vidéoconférence, Skype, etc.</p>
                <p className="survey-description">Sur ?</p>
                
                <div className="employees-container">
                    <img src={emp} alt="employee icon" />
                </div>
                <div className="employee-counter">
                    <button className="counter-btn" onClick={decrementCount}>-</button>
                    <span className="employee-count">{employeeCount}</span>
                    <button className="counter-btn" onClick={incrementCount}>+</button>
                </div>
                <button className="next-btn" onClick={goToInterface3} >Suivant</button>
            </div>

            {/* Deuxième partie */}
            <div className="video-quality-section">
                <p className="quality-description">
                Facultatif: Sélectionnez la qualité vidéo et le nombre de personnes sur les appels vidéo?
                </p>
                <div className="quality-options">
                    <button className="quality-btn">Petit groupe (3-5)</button>
                    <button className="quality-btn">Grand groupe (7+)</button>
                    <button className="quality-btn">Groupe bas</button>
                    <button className="quality-btn">Groupe standard</button>
                    <button className="quality-btn">HD (1080p)</button>
                </div>
            </div>
        </div>
    );
}

function NavBar() {
    return (
        <div className="navbar">
            <img src={logo} alt="Topnet Logo" className="logo" />
            <ProgressBar progress={60} />
            <SpeedDisplay speed={0} />
        </div>
    );
}

function ProgressBar({ progress }) {
    return (
        <div className="progress-bar-container">
            <div className="progress-bar" style={{ width: `${progress}%` }}></div>
        </div>
    );
}

function SpeedDisplay({ speed }) {
    return (
        <div className="speed-display-container">
            <div className="speed-text">
                Vitesse Minimum <br />
                Recommandée
            </div>
            <div className="speed-value">{speed} <span className="speed-unit">Mbps</span></div>
        </div>
    );
}

function InfoTooltip() {
    const [isVisible, setIsVisible] = useState(false);

    const toggleTooltip = () => {
        setIsVisible(!isVisible);
    };

    return (
        <div className="tooltip-container">
            <div className="tooltip-icon" onClick={toggleTooltip}>?</div>
            {isVisible && (
                <div className="tooltip-box">
                    <p>
                    Bien que les appels vidéo ne nécessitent pas de vitesses élevées, vous devrez prévoir un peu de bande passante supplémentaire pour les appels vidéo HD ou les conférences téléphoniques avec de grands groupes.
                    </p>
                </div>
            )}
        </div>
    );
}



export default Ife4
